import React from 'react'
import Show from './Show';
import { Link, Route, BrowserRouter as Router  } from 'react-router-dom';

const App = () => {
    return (
        <Router>
            <Link to="/show/bob">
                <div>Click Me To Go To Bob</div>
            </Link>
            <Route path='/show/:name?' component={Show} />
        </Router>
    )
}
export default App;
